Le Point Q
~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~

Synopsis: Everything Changes for Dr. Loic Perrin when a circus manager, mauled by his wild animals, tells him The secret before dying...the existence of the &quot;Q&quot; spot, a very special zone in the anal nether regions which causes an indescribable wave of pleasure, even for the most frigid of women. We dutifully share the experiences of the good doctor.. In the interest of science.

Cast: Monica Moore, Dolly Golden, Daniella Rush, Dru Berrymore, Vivienne, Cassandra, Maeva, Isabelle, Angela Tiger, Lou Valmont, K. Sandra, Priscilla Lenn, Latifa, Christophe Clark, Roberto Malone, Titof, Sebastian Barrio, Alain L'yle, Bruno Aissix, Reda, Marc Dorcel ProducerAlain Payet,Director

